import React, { useState, useEffect } from 'react';

import Questions from './components/Questions';
import SplitPane from 'react-split-pane';
import EditorSection from './components/layout/editor-section';
import ProblemSection from './components/layout/problem-section';
import TestcaseSection from './components/layout/testcase-section';


import './App.css';
import './styles/styles.css';

export default function App() {

  let [questions, setQuestion] = useState([]);

  useEffect(() => {
    fetch("http://localhost:3001")
      .then(res => res.json())
      .then(data => {
          setQuestion(data.data);
        },
        (error) => {
          setQuestion(error);
        }
      )
  }, []);

  return (
    <div className="App">
      <SplitPane
      split='vertical'
      defaultSize='45%'
      minSize={400}
      maxSize={900}
      >
        <ProblemSection question={questions}/>
        <div class="right">
          <EditorSection/>
          <TestcaseSection question={questions}/>
        </div>
      </SplitPane>
      {/* <Questions question={questions}/> */}
    </div>
  );
}
